import { useVideos } from "./videos-context";

const videoReducer = (state, action) => {
    const {videoDispatch} = useVideos
  switch (action.type) {
    case "SAVE_API_DATA":
      console.log(action.value);
      return state;
  }
};

export { videoReducer };
